import { Lista } from './styles';

export function ListaMenu(){
    return (
        <Lista>
            <ul>
                <li>OUR WORK</li>
                <li>ABOUT US</li>
                <li>CAREERS</li>
                <li>BLOG</li>
                <li>AWARDS</li>
                <li>CONTACT</li>
            </ul>
        </Lista>
    )
}
